    public static boolean canVisitAllRooms(List<List<Integer>> rooms) {
        int totalRooms = rooms.size();
        Queue<Integer> keys = new LinkedList<>();
        HashSet<Integer> foundKeys = new HashSet<>();
        keys.add(0);
        foundKeys.add(0);
        while (!keys.isEmpty()){
            Integer poll = keys.poll();
            List<Integer> keysList = rooms.get(poll);
            if (keysList != null && keysList.size() > 0){
                for (Integer curKey : keysList) {
                    if (!foundKeys.contains(curKey)) {
                        foundKeys.add(curKey);
                        keys.add(curKey);
                    }
                }
            }
        }
        for (int i = 0; i < totalRooms; i++) {
            if (!foundKeys.contains(i)){
                return false;
            }
        }
        return true;
    }

